import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { View, Text, Button, StyleSheet } from 'react-native';

function OrderLists() {   
  const tripData = [
  {
    title: "Trip Activity : June 10th 2022",
    data: [
      { tripId : "TRIP NUMBER - 00001",from : "Yangon",to : "NEW YORK", tripStatus: "Drop off"},
      { tripId : "TRIP NUMBER - 00002",from : "Yangon",to : "LOS ANGELES", tripStatus: "Pick-Up"}, 
      { tripId : "TRIP NUMBER - 00003",from : "Yangon",to : "Singapore", tripStatus: "Drop off"}
    ]
  },
  {
    title: "Trip Activity : June 19th 2022",
    data: [
      { tripId : "TRIP NUMBER - 00001",from : "Yangon",to : "NEW YORK", tripStatus: "Drop off"},
      { tripId : "TRIP NUMBER - 00002",from : "Yangon",to : "LOS ANGELES", tripStatus: "Pick-Up"}, 
      { tripId : "TRIP NUMBER - 00003",from : "Yangon",to : "Singapore", tripStatus: "Drop off"}
    ]
  }
];
  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.mainText}> ORDER </Text>
        <Text style={styles.text}> TRIP LIST  </Text>
      </View>
      <Text>Order Screen!</Text>
      <Button title="Go to Home" onPress={() => navigation.navigate('HOME')} />
    </View>
  );
} 

const RootStack = createNativeStackNavigator();
export default function OrderScreen(info) {
  console.log(info.data)
  return (
    <NavigationContainer independent={true}>
      <RootStack.Navigator>
        <RootStack.Screen name="OrderLists" component={OrderLists} options={{headerShown: false }}  initialParams={{currentCity: 'Yangon'}} />
        {/* <RootStack.Screen name="CreateFacility" component={FacilityCreateScreen} options={{headerShown: false}}/> */}
      </RootStack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1, 
    marginHorizontal: 20
  },
  header: {
    flex: 1,
    flexDirection: 'column', 
    paddingVertical: 60
  },
  mainText: {
    fontSize: 25,
    fontFamily: 'UbuntuBold',
    paddingLeft: 5, 
  },
  text: {
    fontSize: 18,
    fontFamily: 'UbuntuBold',
    padding : 10,
  },
});
